export const Home = ({ trends }) => {
	return (
		<Container>
			{trends.map((product) => (
				<ul key={product.id}>
					<Link to={`${product.id}`}>
						<li>{product.title}</li>
					</Link>
				</ul>
			))}
		</Container>
	);
};
